webpackJsonp([0xa7bdfd7fdc68],{402:function(e,n){e.exports={data:{markdownRemark:{html:'<blockquote>\n<p>这里讲述的是一个 8 级（kyu）菜鸟立志成为 8 段（dan）大神的故事。故事的起因是这样的。菜鸟有幸发现了 <a href="http://www.codewars.com/">codewars</a> 这个网站，从此沉迷于内一发不可收拾，他在代码战争中一次次遭遇挫败，又一次次爬起来继续跌倒下去。欲知详情，且看『迈向 7 级的第一个脚印』。</p>\n</blockquote>\n<blockquote>\n<p>遥想当年自高自大，而今终知天外有天。</p>\n</blockquote>\n<h3>Description:</h3>\n<p>The numberOfOccurrences function must return the number of occurrences of an element in an array.</p>\n<h3>Example:</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>var arr = [0, 1, 2, 2, 3]\n\narr.numberOfOccurrences(0) === 1\narr.numberOfOccurrences(4) === 0\narr.numberOfOccurrences(2) === 2\narr.numberOfOccurrences("a") === 0</code></pre>\n      </div>\n<h3>菜鸟出招</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>Array.prototype.numberOfOccurrences = function(num) {\n  var total = 0\n\n  for (var i = 0; i < this.length; i++) {\n    if (this[i] == num) {\n      total++\n    }\n  }\n\n  return total\n}</code></pre>\n      </div>\n<h3>菜鸟思维</h3>\n<ol>\n<li>利用数组遍历</li>\n<li>如果数值相等则加 1</li>\n<li>返回标记总数的变量</li>\n</ol>\n<h3>偷师学艺</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>Array.prototype.numberOfOccurrences = function(search) {\n  return this.filter(function(num) {\n    return search === num\n  }).length\n}</code></pre>\n      </div>\n<h3>关键字积累</h3>\n<ul>\n<li>prototype</li>\n<li>filter</li>\n</ul>\n<h3>菜鸟总结</h3>\n<p><code>filter()</code>是 <code>ECMAScirpt 5</code> 中规定的数组方法，返回的数组元素是调用的数组的一个子集。传递的函数是用来逻辑判定的：该函数返回 <code>true</code> 或是 <code>false</code>。如果返回值为 <code>true</code> 或是能转化为 <code>true</code> 的值，那么传递给判定函数的元素就是这个子集的成员，它将被添加到一个作为返回值的的数组中。</p>\n<p><code>filter()</code> 会跳过稀疏数组中缺少的元素，它的返回值总是稠密的。为了压缩稀疏数组的空缺，代码如下：</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>var dense = sparse.filter(function() {\n  return true\n})</code></pre>\n      </div>\n<p>如果压缩空缺并删除 <code>undefined</code> 和<code>null</code>元素，代码如下：</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>var a = a.filter(function(x) {\n  return x !== undefined && x !== null\n})</code></pre>\n      </div>',frontmatter:{title:"My Code Wars v0.1",date:"2015-11-06",category:"技术",tags:["CodeWars"],cover:null}},site:{siteMetadata:{url:"http://blog.sqrtthree.com/",thumbnail:"",defaultAuthor:"根号三",donation:{status:!0,channel:{alipay:"http://7xl8me.com1.z0.glb.clouddn.com/alipay.JPG",wechat:"http://7xl8me.com1.z0.glb.clouddn.com/wechat_receive_money.JPG"}},share:!0}}},pathContext:{slug:"/myCodeWars-01/",title:"My Code Wars v0.1",excerpt:"这里讲述的是一个 8 级（kyu）菜鸟立志成为 8 段（dan）大神的故事。故事的起因是这样的。菜鸟有幸发现了  codewars  这个网站，从此沉迷于内一发不可收拾，他在代码战争中一次次遭遇挫败，又一次次爬起来继续跌倒下去。欲知详情，且看『迈向…",prev:{fields:{slug:"/jQuery3-0-Alpha-Versions-Released/"},frontmatter:{title:"jQuery 3.0 以及兼容版的 Alpha 版本发布",category:"技术",tags:["jQuery3.0","译文"],cover:null,date:"2015-11-12"},excerpt:"从我们做出上一个重大的版本发布已经过去很长时间了，所以你理应再得到一个新版本。因此我们非常高兴的宣布  jQuery 3.0  的第一个  alpha  版本的发布。 尽管版本号已经到了 3.…"},next:{fields:{slug:"/jquery3-the-next-generations/"},frontmatter:{title:"jQuery 3.0 —— 下一代的jQuery",category:"技术",tags:["jQuery3.0","译文"],cover:null,date:"2015-11-05"},excerpt:"2014 年 10 月 29 日，jQuery 官方博客上更新了一篇博文，描述了关于下一代 jQuery 的一些信息。实际上这篇博文至今都已经一年时间了，jQuery 官方团队也早在 2015 年 7 月 13 日发布了  jQuery 3.0.0-alpha…"}}}}});
